import React, { Component } from 'react';
import Drone from '../assets/Drone.png';

class DroneBanner extends Component {
  render() {
    return (
      <div className="drone">
        <img src={Drone} alt="F-210 Drone"/>
        <h1>f-210</h1>
      </div>
    );
  }
}

export default DroneBanner;
